// ! Create ID Anggota
let d = new Date();
let t = d.getTime();
let counter = 'A' + t;

// ! Form Tambah Anggota
document.getElementById("form").addEventListener("submit", (e) => {
    let nama = document.getElementById('nama').value;
    let jenis_kelamin = document.getElementById('jenis_kelamin').value;
    let kelas = document.getElementById('kelas').value;
    let no_hp = document.getElementById('no_hp').value;
    let email = document.getElementById('email').value;
    let image = document.getElementById('image').files[0];
    e.preventDefault();

    createAnggota(nama, jenis_kelamin, kelas, no_hp, email, image);
})


// ! Form Ubah Anggota
document.getElementById("form-ubah").addEventListener("submit", (e) => {
    let id = document.getElementById('ubah-id').value;
    let nama = document.getElementById('ubah-nama').value;
    let jenis_kelamin = document.getElementById('ubah-jenis_kelamin').value;
    let kelas = document.getElementById('ubah-kelas').value;
    let no_hp = document.getElementById('ubah-no_hp').value;
    let email = document.getElementById('ubah-email').value;
    e.preventDefault();

    updateAnggota(id, nama, jenis_kelamin, kelas, no_hp, email);
})

// ! Show Isi Modal Anggota
function showAnggota(id, nama, jenis_kelamin, kelas, no_hp, email) {
    document.getElementById("ubah-id").value = id;
    document.getElementById("ubah-nama").value = nama;
    document.getElementById("ubah-jenis_kelamin").value = jenis_kelamin;
    document.getElementById("ubah-kelas").value = kelas;
    document.getElementById("ubah-no_hp").value = no_hp;
    document.getElementById("ubah-email").value = email;
}

// ! Create Anggota
function createAnggota(nama, jenis_kelamin, kelas, no_hp, email, image) {
    document.getElementById('button1').disabled = true;
    document.getElementById('button1').innerHTML = 'Menambah anggota...';
    counter += 1;

    let imageName = image.name;

    let metadata = {
        contenType: image.type
    }
    let storage = firebase.storage().ref();
    let upload = storage.child(imageName).put(image, metadata);

    upload.then(snapshot => snapshot.ref.getDownloadURL()).then(url => {
        let data = {
            id: counter,
            image: url,
            nama: nama,
            jenis_kelamin: jenis_kelamin,
            kelas: kelas,
            no_hp: no_hp,
            email: email,
            search: name,
            tgl_dibuat: dateNow(),
        }

        let db = firebase.database().ref("Anggota/" + counter);
        db.set(data);

        document.getElementById('button1').disabled = false;
        document.getElementById('button1').innerHTML = 'Tambah Anggota';
        window.alert('Tambah Anggota Berhasil !');
        $('#modalTambahAnggota').modal('hide')
        document.getElementById("cardSection").innerHTML = '';

        readAnggota();
    })
}

// ! Update Anggota (Belum coba delete gambar dari storage)
function updateAnggota(id, nama, jenis_kelamin, kelas, no_hp, email) {
    document.getElementById('button2').disabled = true;
    document.getElementById('button2').innerHTML = 'Mengubah anggota...';

    let data = {
        id: id,
        nama: nama,
        jenis_kelamin: jenis_kelamin,
        kelas: kelas,
        no_hp: no_hp,
        email: email,
        search: nama,
    }

    console.log(data);

    let db = firebase.database().ref("Anggota/" + id);
    db.update(data);

    document.getElementById('button2').disabled = false;
    document.getElementById('button2').innerHTML = 'Ubah Anggota';
    window.alert('Ubah Anggota Berhasil !');
    $('#modalUbahAnggota').modal('hide')
    document.getElementById("cardSection").innerHTML = '';

    readAnggota();
}

document.getElementById('filter').addEventListener('click', (e) => {
    let filter = document.getElementById('urutkan').value;
    document.getElementById("cardSection").innerHTML = '';

    readAnggota(filter);
})

// ! Read Anggota
function readAnggota(filter = 'nama') {
    let db = firebase.database().ref("Anggota/").orderByChild(filter);
    db.on("child_added", function (data) {
        let Value = data.val();
        document.getElementById("cardSection").innerHTML += `
        <div class="row">
            <div class="col-md-12 mb-3">
                <div class="card">
                    <div class="card-header">
                        ${Value.nama}
                    </div>
                    <div class="card-body">
                        <div class="row">
                             <div class="col-lg-4">
                                <img src="${Value.image}" style="width:220px; height:300px" class="card-img-top img-thumbnail" alt="...">
                            </div>
                            <div class="col-lg-8">
                                <p class="card-text">ID Anggota : ${Value.id}</p>
                                <p class="card-text">Nama Anggota : ${Value.nama}</p>
                                <p class="card-text">Jenis Kelamin : ${Value.jenis_kelamin}</p>
                                <p class="card-text">Kelas : ${Value.kelas}</p>
                                <p class="card-text">No Handphone : ${Value.no_hp}</p>
                                <p class="card-text">Email : ${Value.email}</p>
                                <button class="btn btn-info mt-4" onclick="cetakAnggota('${Value.id}')">Cetak Kartu</button>
                                <button class="btn btn-warning mt-4" onclick="showAnggota('${Value.id}', '${Value.nama}', '${Value.jenis_kelamin}', '${Value.kelas}', '${Value.no_hp}', '${Value.email}')" data-toggle="modal" data-target="#modalUbahAnggota">Ubah Anggota</button>
                                <button class="btn btn-danger mt-4" onclick="deleteAnggota('${Value.id}')">Hapus Anggota</button>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
        `;
    })
}


