// ! Delete Anggota (Belum coba delete gambar dari storage)
function deleteAnggota(id) {
    let db = firebase.database().ref("Anggota/" + id);
    let konfirmasi = confirm("Apakah anda yakin ingin menghapus data ini ?");

    if (konfirmasi) {
        db.remove();

        window.alert('Hapus Anggota Berhasil !');
        document.getElementById("cardSection").innerHTML = '';

        readAnggota();
    } else {
        return false;
    }
}

